BEGIN TRANSACTION;
CREATE TABLE `subscenario_m` (
    `subscenario_id` INTEGER NOT NULL,
    `unit_id` INTEGER NOT NULL,
    `title` TEXT NOT NULL,
    `title_call_asset` TEXT,
    `title_font` INTEGER,
    `asset_bgm_id` INTEGER NOT NULL,
    `unlocked_live_difficulty_id` INTEGER,
    `release_tag` TEXT, `_encryption_release_id` INTEGER NULL,
    PRIMARY KEY (`subscenario_id`)
);
CREATE TABLE `subscenario_reward_m` (
    `subscenario_reward_id` INTEGER NOT NULL,
    `subscenario_id` INTEGER NOT NULL,
    `add_type` INTEGER NOT NULL,
    `reward_item_id` INTEGER NOT NULL,
    `item_category_id` INTEGER NOT NULL,
    `amount` INTEGER NOT NULL,
    `comment` TEXT,
    PRIMARY KEY (`subscenario_reward_id`)
);
CREATE TABLE `subscenario_setting_disp_m` (
    `subscenario_setting_disp_id` INTEGER NOT NULL,
    `subscenario_setting_id` INTEGER NOT NULL,
    `scenario_char_effect_cd` TEXT,
    `scenario_char_asset_id` INTEGER NOT NULL,
    `display_position` INTEGER NOT NULL,
    `character_action_type` INTEGER,
    `speaker_flag` INTEGER NOT NULL,
    PRIMARY KEY (`subscenario_setting_disp_id`)
);
CREATE TABLE `subscenario_setting_m` (
    `subscenario_setting_id` INTEGER NOT NULL,
    `subscenario_id` INTEGER NOT NULL,
    `order_num` INTEGER NOT NULL,
    `asset_background_id` INTEGER,
    `character_name` TEXT,
    `scene_effect_type` INTEGER,
    `asset_voice_id` INTEGER,
    `asset_se_id` INTEGER,
    `asset_bgm_id` INTEGER,
    `release_tag` TEXT, `_encryption_release_id` INTEGER NULL,
    PRIMARY KEY (`subscenario_setting_id`)
);
CREATE TABLE `subscenario_sort_m` (
    `unit_type_id` INTEGER NOT NULL,
    `sort` INTEGER NOT NULL,
    `release_tag` TEXT, `_encryption_release_id` INTEGER NULL,
    PRIMARY KEY (`unit_type_id`)
);
CREATE INDEX `idx_display_position` ON `subscenario_setting_disp_m`(`subscenario_setting_id`,`display_position`);
COMMIT;
